import logo from "./logo.svg";
import "./App.css";
import UserList from "./components/userList";
import UserDetail from "./components/UserDetail";

const UserData = [
  {
    id: 1,
    name: "Mitesh",
    email: "mitesh@gmail.com",
  },
  {
    id: 2,
    name: "Jack",
    email: "jack@gmail.com",
  },
  {
    id: 3,
    name: "Ali",
    email: "Ali@gmail.com",
  },
];

const Users = UserDetail(
  UserList,
  UserData
);

function App() {
  return (
    <div>
    <Users></Users>
  </div>
  );
  // render(){
  // return UserDetail(UserList, UserData);
  // }
  // return <div className="App">{UserDetail(UserList, UserData)}</div>;
}

export default App;
